import { Outlet, Navigate } from 'react-router-dom';

const PrivateRoute = () => {
  const authToken = sessionStorage.getItem("authToken");

  // Check if userAuth is not null and isAuth is "true"
  if (authToken) {
    return <Outlet />;
  } else {
    return <Navigate to="/login" />;
  }
};

export default PrivateRoute;
